import styled from 'styled-components'
 export const StyledNavbar=styled.nav`
 margin:0;
height:50px;
color: black ;
background: grey;
display : flex;
flex-direction: row;
justify-content:space-between;
@media (max-width: 768px) {
    flex-direction: column;
  }
`;
